import React, {Fragment} from "react";

const List  = (props) => {
    
    return (
      <Fragment>
        <li id={props.id}>Order: {props.order} Prize: {props.prize} </li>
        <button id={props.id} type="submit" onClick={props.onDelete}>Delete</button>
        </Fragment>
    )
}

export default List;
